// Menu.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Menu.css'; // Zaimportuj plik ze stylami


const Menu = () => {
  return (
    <nav className="menu">
      {/* Dodaj linki do rejestracji, logowania oraz strony głównej */}
      <Link to="/">Strona główna</Link>
      <Link to="/register">Rejestracja</Link>
      <Link to="/login">Logowanie</Link>
    </nav>
  );
};

export default Menu;
